import axios from "axios";
import {useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState();

  useEffect(()=>{
    axios.get('/', (res) =>{
      setData(res);
    })
  })

  return (
    <div className="App">
      {
        data && data.map ((item)=>{
          <p>item.Loai_Phong</p>
        })
      }
    </div>
  );
}

export default App;
